svg.script:
function $(sel) {
  return document.querySelector(sel);
}

function update_menu() {
  $("#menu_1").setAttribute("class", "menu");
  $("#menu_2").setAttribute("class", "menu");
  $("#menu_3").setAttribute("class", "menu");
  $("#menu_link1").setAttribute("class", "");
  $("#menu_link2").setAttribute("class", "");
  $("#menu_link3").setAttribute("class", "");
  $("#uncover").setAttribute("class", "invis");
  $("#optimise").setAttribute("class", "invis");
  $("#monitor").setAttribute("class", "invis");
}

$("#menu_link1").onclick = function() {
  update_menu();
  $("#menu_1").setAttribute("class", "menu selected");
  $("#menu_link1").setAttribute("class", "selected");
  setTimeout(function() {
    $("#uncover").setAttribute("class", "");
  }, 400);
};

$("#menu_link2").onclick = function() {
  update_menu();
  $("#menu_2").setAttribute("class", "menu selected");
  $("#menu_link2").setAttribute("class", "selected");
  setTimeout(function() {
    $("#optimise").setAttribute("class", "");
  }, 400);
};

$("#menu_link3").onclick = function() {
  update_menu();
  $("#menu_3").setAttribute("class", "menu selected");
  $("#menu_link3").setAttribute("class", "selected");
  setTimeout(function() {
    $("#monitor").setAttribute("class", "");
  }, 400);
};

document.addEventListener("DOMContentLoaded", function(event) {
  setTimeout(function(){
    update_menu();
    $("#menu_1").setAttribute("class", "menu selected");
    $("#menu_link1").setAttribute("class", "selected");
    $("#uncover").setAttribute("class", "");
  }, 400);
});
